//import Frontend from "./Frontend";
import React from "react";
import './App.css';



class App extends React.Component {

  // Constructor 
  constructor(props) {
    super(props);

    this.state = {
      items: [],
      DataisLoaded: false
    };
  }

  // ComponentDidMount is used to
  // execute the code 
  componentDidMount() {
    fetch(
      "https://api.documenu.com/v2/restaurants/zip_code/10065?key=82dbeaac7b3078a26ab28e0736ecf8ee")
      //"https://api.documenu.com/v2/restaurant/4072702673999819?key=82dbeaac7b3078a26ab28e0736ecf8ee")
      //"https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          items: json,
          DataisLoaded: true
        });
      })
  }

  render() {
    const { DataisLoaded, items } = this.state;
    if (!DataisLoaded) return <div>
      <h1> Pleses wait some time.... </h1> </div>;

    //console.log(items.data)
    for(let i = 0; i < items.data.length; i++){
      console.log(items.data.i);
    }


    return (
      <div className="App">
        <h1> Fetch data from an api in react </h1>{
          //document.write(items['data']['0']['restaurant_name'])  
          items.data.map((item) => (
            <ol key={item.id} >
              restaurant_name: {item.restaurant_name},
            </ol>
          ))
        }

      </div>
    );
  }
}

export default App;
